import "materialize-css/dist/css/materialize.min.css";
import CSS from "csstype";
import { Component } from "react";

// Estilos personalizados
const backgroundColor: CSS.Properties = {
  backgroundColor: "#49786d",
};
const fontStyle: CSS.Properties = {
  fontSize: "xx-large",
  fontFamily: "arial",
};

const botaoStyle: CSS.Properties = {
  padding: "10px",
  fontFamily: "arial",
  backgroundColor: "#49786d",
};

const botaoColor: CSS.Properties = {
  backgroundColor: "#49786d",
  fontFamily: "arial",
};

// Componente principal
class PaginaInicial extends Component<any, any> {
  render() {
    return (
      <div>
        <nav className="nav-wrapper" style={backgroundColor}>
          <a className="brand-logo center" style={fontStyle}>
            World Beauty
          </a>
        </nav>

        <div className="container">
          <div className="section">
            {/* As Abas de Cadastro */}
            <ul id="tabs-swipe-demo" className="tabs">
              <li className="tab col s3">
                <a href="#cliente" style={botaoStyle}>
                  Cadastrar Clientes
                </a>
              </li>
              <li className="tab col s3">
                <a href="#produto" style={botaoStyle}>
                  Cadastrar Produtos
                </a>
              </li>
              <li className="tab col s3">
                <a href="#servico" style={botaoStyle}>
                  Cadastrar Serviços
                </a>
              </li>
              <li className="tab col s3">
                <a href="#pedido" style={botaoStyle}>
                  Cadastrar Consumo
                </a>
              </li>
            </ul>

            {/* Conteúdo das Abas */}
            <div id="cliente" className="col s12">
              <a href="/formularioCadastroCliente" className="waves-effect waves-light btn">
                Acessar Cadastro de Clientes
              </a>
            </div>
            <div id="produto" className="col s12">
              <a href="/formularioCadastroProduto" className="waves-effect waves-light btn">
                Acessar Cadastro de Produtos
              </a>
            </div>
            <div id="servico" className="col s12">
              <a href="/formularioCadastroServico" className="waves-effect waves-light btn">
                Acessar Cadastro de Serviços
              </a>
            </div>
            <div id="pedido" className="col s12">
              <a href="/formularioCadastroPedido" className="waves-effect waves-light btn">
                Acessar Cadastro de Consumo
              </a>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default PaginaInicial;
